//   }
// ])
const isMenuActive = ref(false); // 서비스 메뉴탭이 최초 활성화 되었는지 체크
const performArea = ref([]);

const currentPart = ref(null); //현재 활성화된 부위
const selectedTabNum = ref(null);
const addedPart = ref([]);
const svgVhP = ref(null);
const markerP = ref(null);
const menus = ref([]);
const serviceTabMenuObj = ref([
  {
    name: "도장",
    value: "P",
  },
  {
    name: "판금",
    value: "U",
  },
  {
    name: "교환",
    value: "X",
  },
  {
    name: "덴트",
    value: "R",
  },
]);

const obj = ref({ x: null, y: null, w: null, h: null }); //부위좌표

//부위클릭
function onClickEvent(event) {
  // showAlert을 한 번만 실행

  if (isMenuActive.value === false) {
    showAlert("서비스할 메뉴를 먼저 선택해주세요.");
    return false;
  } else {
    const svgTarget = event.target;
    enablePartitons(svgTarget);

    //svg 부위정보 가져오기 : 위치, 크기
    const svgPath = event.target.getBBox();

    const markerSize = 20;

    obj.value.x = svgPath.x + (svgPath.width - markerSize) / 2 - (svgPath.width - markerSize) / 2;
    obj.value.y = svgPath.y + (svgPath.height - markerSize) / 2;
    obj.value.w = svgPath.width;
    obj.value.h = svgPath.height;

    const selectedMarker = serviceTabMenuObj.value[selectedTabNum.value].value;

    pushCarPartitions([svgTarget.getAttribute("data-part-name"), svgTarget.getAttribute("data-class-name")], selectedMarker);
  }
}

//이미 저장된 파티션에대한 서비스 부위가 있다면 push를 하지말고 기존만들어진곳에 추가
function pushCarPartitions(partitionsName, selectedMarker) {
  const existingPartition = performArea.value.find((partition) => partition.ptNm === partitionsName[0] && partition.csNm === partitionsName[1]);

  // 없다면 새로 푸시
  if (!existingPartition) {
    performArea.value.push({
      ptNm: partitionsName[0],
      csNm: partitionsName[1],
      isActivated: true,
      marker: {
        P: false,
        U: false,
        X: false,
        R: false,
      },
    });
    //마커 중복체크 : 마커가 없다면 추가
    checkMarker(selectedMarker, partitionsName[1]);
  } else {
    //마커 중복체크 : 마커가 없다면 추가
    checkMarker(selectedMarker, partitionsName[1]);
  }
}

//마커가 이미 추가 되었는지를 비교
function checkMarker(sMark, partitions) {
  performArea.value.forEach((parts) => {
    if (partitions === parts.csNm) {
      for (let key in parts.marker) {
        if (parts.marker[key] === false && key === sMark) {
          parts.marker[key] = true;

          createEMarker(serviceTabMenuObj.value[selectedTabNum.value].value);
        }
      }
    }
  });
  console.log(performArea.value);
}
//상품화 부위 컬러 활성화
//처음 실행은 무조건 배열에 push 후
// 부위가 이미 선택되었다면
function enablePartitons(svgTarget) {
  // 서비스 메뉴탭이 최초 활성화 되었는지 체크

  menus.value.forEach((menu) => {
    // 메뉴가 체크 되었다면 부위 활성화 진행
    if (menu.classList.contains("active")) {
      if (!svgTarget.classList.contains("active")) {
        svgTarget.classList.add("active");
        currentPart.value = svgTarget.getAttribute("data-class-name");

        console.log(currentPart.value);
        addedPart.value.push({
          class: svgTarget.getAttribute("data-class-name"),
          name: svgTarget.getAttribute("data-part-name"),
          addedPart: {
            p: true,
            u: false,
            x: false,
            r: false,
          },
        });
        return false;
      }
    }
  });
}
//01. 메뉴 생성
function menuTab(e, num) {
  menus.value.forEach((menu) => {
    if (menu.classList.contains("active")) {
      menu.classList.remove("active");
    }
  });
  e.target.classList.add("active");
  isMenuActive.value = true;
  selMarker(num);
}

function showAlert(msg) {
  alert(msg);
}

//02. 마커 생성
function createEMarker(text) {
  const vhp = document.body.querySelector(`#vhPerformArea`);

  //마커가 이미 생성되었는지 찾기
  const markerElement = findMarkerByClass([currentPart.value]);

  if (markerElement) {
    //같은부위에 이미 생성된 마커가 있다면 그곳에 마커를 집어넣기
    console.log("같은 클래스가 있습니다.", markerElement);
    markerElement.innerHTML += `<span>${text.toUpperCase()}</span>`;
  } else {
    console.log("같은 클래스가 없습니다.", markerElement);
    // 새로운 span태그 복제
    const marker = document.createElement("div");
    marker.classList.add("marker");
    marker.classList.add(currentPart.value);
    //아니라면 새로이 마커를 만들기
    vhp.appendChild(marker);
    marker.innerHTML = `<span>${text.toUpperCase()}</span>`;

    //marker.style.transform = `translate(${obj.x}px, ${obj.y}px)`
    marker.style.minWidth = obj.value.w + "px";

    marker.style.top = obj.value.y + "px";
    marker.style.left = obj.value.x + "px";
    marker.style.zIndex = 101;
    //vhp.innerHTML = `<span>${text}</span>`
  }
}

function findMarkerByClass(classNames) {
  const markers = document.querySelectorAll(".marker");
  let foundMarker = null;

  markers.forEach((marker) => {
    const classList = marker.classList;
    if (classList.contains(...classNames)) {
      foundMarker = marker;
      return false; // forEach 루프 종료
    }
  });

  return foundMarker;
}

//03. 메뉴탭 선택시 차량 부위에 대한 서비스 마커를 표시하기 위해 글로벌로 메뉴탭 정의
function selMarker(n) {
  selectedTabNum.value = n;
}

onMounted(() => {
  svgVhP.value = document.body.querySelector("#svgVhP");
  markerP.value = document.body.querySelector("#markerP");
  document.querySelectorAll("#commercial .menu li").forEach((menu) => {
    menus.value.push(menu);
  });
});
</script>

